import { Link, useNavigate } from "react-router-dom"
import BasicDropdown from "./BasicDropdown";
import { useState } from "react";
import { useEffect } from "react";
import io from 'socket.io-client';
import Burger from "./Burger";
const PastLeaderboard = (inp) => {
    let navigate = useNavigate()
    document.body.style.background = '#292C2E'
    const socket = io('localhost:5000', { path: '/server' })
    socket.emit('get_past_dates')
    socket.on('connect', (data) => {
        socket.on('past_dates', (data) => {
            console.log(data)
        })
    })
    return (
        <div>
            <Burger></Burger>
            <p style={{ fontFamily: 'specialhelvetica', color: "white", marginTop: "4%", marginLeft: "1%", fontSize: "4vh" }}>
                Past Discussions
            </p>
            <button style={{ border: "1px solid #5f6368", display: "block", fontSize: "4vh", marginBottom: "3%", width: "96%", marginLeft: "2%" }} onClick={() => { navigate("/current/hughes/2/leaderboard") }}>
                Hughes Period 2
            </button>
        </div>
    )
}

export default PastLeaderboard
